import React, { Component } from 'react';
import './App.css';
import AppNavbar from './AppNavbar';
import { Link } from 'react-router-dom';
import { Button, Container } from 'reactstrap';

class Home extends Component {
  render() {
    return (
      <div>
        <AppNavbar/>
        <Container fluid>
          <Button color="link"><Link to="/promotions,/schema">Manage promotion List</Link></Button>
          <span className="sm-block"><span className="fLink" onClick={this.toggle}>Terms of use</span> 
          | <span className="fLink" onClick={this.toggle}>Privacy Policy</span></span>
        </Container>
      </div>
    );
  }
}

export default Home;
